import React from "react";
import Wrapper from "./components/Wrapper";
import Title from "./components/Title";
import FriendCard from "./components/FriendCard";
import friends from "./friends.json"


function App() {
  return (
    <Wrapper>
      <Title>Friends List</Title>
      <FriendCard image="https://vignette2.wikia.nocookie.net/fictionalcharacters/images/a/ac/Squidward.png/revision/latest?cb=20131121012626" name="spongebob" occupation="sponge" location="sea floor" />

      <FriendCard image="https://vignette3.wikia.nocookie.net/vsbattles/images/8/80/Mr._Krabs.png/revision/latest?cb=20150919162131" name="tester" occupation="blah" location="eek" />

      <FriendCard image="https://vignette2.wikia.nocookie.net/fictionalcharacters/images/a/ac/Squidward.png/revision/latest?cb=20131121012626" name="boom" occupation="chaka" location="laka" />

      <FriendCard image="https://vignette2.wikia.nocookie.net/fictionalcharacters/images/a/ac/Squidward.png/revision/latest?cb=20131121012626" name="fraaaacks" occupation="leaches" location="crap" />

      <FriendCard image="https://vignette.wikia.nocookie.net/spongebobgalaxy/images/0/07/SpongeBob_SquarePants.png/revision/latest?cb=20171228024014" name="lkajflkjsa" occupation="kjalkfj" location="kjhaklfh" />


<Title>Friends List</Title>
{friends.map(function(element,index){
  return <FriendCard  
  name={element.name}
  image={element.image}
  occupation/>

})}

</Wrapper>
  );
}

export default App;
